	update set
	[UserID] = s.[UserID],[Name] = s.[Name],[AccessType] = s.[AccessType],[Settings] = s.[Settings]
when not matched by target then
	insert([ID],[UserID],[Name],[AccessType],[Settings])
	values(s.[ID],s.[UserID],s.[Name],s.[AccessType],s.[Settings]);
